import React, { Component } from 'react'

export class Head extends Component {

    HeadStyle =  {
      backgroundColor: 'red'
    }

    render() {
        return (
            <div style = { HeadStyle }>
                Primeiro Componente
            </div>
        )
    }
}

export default Head
